import React from "react";

const Movies = (props) => {
  const { moviesList, imagePath } = props;

  return (
    <div>
      <ul>
        {moviesList.map((m) => {
          return (
            <li>
              <img key={m.id} src={imagePath + m.poster_path} alt={m.title} />
              <h3>{m.title}</h3>
              <p>{m.vote_average}</p>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Movies;
